import React from "react";
import sampleImage from "../nick-wessaert-unsplash.jpg";

const Introduction = (props) => (
  <div className="center">
    <div className="text-container">
      <h2>Hi, I'm Osas</h2>
      <h4>
        I am a fullstack developer who likes to make apps using React and Node.
      </h4>
      <h4>
        I am currently learning to make mobile apps using React native.
      </h4>
    </div>
    <div className="img-container">
      <img src={sampleImage} alt="Osas Alohan" />
    </div>
  </div>
);

export default Introduction;
